'''
318. Maximum Product of Word Lengths

Given a string array words, find the maximum value of length(word[i]) * length(word[j]) where the two words do not share common letters. You may assume that each word will contain only lower case letters. If no such two words exist, return 0.

Example 1:
Given ["abcw", "baz", "foo", "bar", "xtfn", "abcdef"]
Return 16
The two words can be "abcw", "xtfn".

Example 2:
Given ["a", "ab", "abc", "d", "cd", "bcd", "abcd"]
Return 4
The two words can be "ab", "cd".

Example 3:
Given ["a", "aa", "aaa", "aaaa"]
Return 0
No such pair of words.
'''
class MySolution(object):
    def maxProduct(self, words):
        """
        :type words: List[str]
        :rtype: int
        """
        values = []
        wordsLength = len(words)
        words.sort(key=lambda x: len(x), reverse=True)
        print([x.strip() for x in words])
        for i in range(0, len(words)):
            word = words[i]
            wordLength = len(word)
            for j in range(i + 1, wordsLength):
                otherWord = words[j];
                if self.hasSameCharacter(word, otherWord) == False:
                    values.append([word, otherWord, wordLength * len(otherWord)])
                    return wordLength * len(otherWord)
                    pass
                pass
            pass
        # if not values:
        return 0
        # else:
        #   return max(values, key=lambda x: x[2])
            
    def hasSameCharacter(self, first, second):
        first = set(first)
        second = set(second)
        for char in first:
            if char in second:
                return True
            pass
        return False
        # return bool(first.intersection(second))
        # return 1 in [c in first for c in second]
        
class Solution(object):
    # https://www.hrwhisper.me/leetcode-maximum-product-of-word-lengths/
    def maxProduct(self, words):
        """
        :type words: List[str]
        :rtype: int
        """
        n = len(words)
        elements = [0] * n
        for i, s in enumerate(words):
            for c in s:
                elements[i] |= 1 << (ord(c) - 97)

        ans = 0
        for i in range(n):
            for j in range(i + 1, n):
                if not (elements[i] & elements[j]):
                    ans = max(ans, len(words[i]) * len(words[j]))
        return ans
        
